  \"poplar-island-environmental-restoration-project-nekton-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Poplar Island Environmental Restoration
  Project (PIERP) is a large scale 1,800 acres restoration project located in mid
  Chesapeake Bay.  Fishery collections are conducted three times per year to assess
  fishery use of restored wetlands.  Collection gear types used included fyke net,
  gill net, crab pot, and otter trawl all used to assess forage and predator fish
  abundances.  Survey data is used to assess the functions of the restored PIERP wetlands,
  and adjacent shallow water habitats influenced by the PIERP, relative to reference
  habitats and to pre-construction conditions.  Data from these collections will also
  help assess restored wetland maturity and its ability to maintain stable resident
  and predator fish populations.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
